@flipkart loses both its co-founders. binny bansal stepped down as the ceo of flipkart following a probe into an allegation of "serious personal misconduct". this has left the employees of flipkart with a sense of uncertainty about the future of the company. in the meanwhile, kalyan krishnamurthy will continue as the ceo of flipkart.

